import ReactDOM from "react-dom";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx";
import Note from "./Note.jsx";
function App()
{
    return <div><Header /> <Note title = "Saini" content = "sdafasd" /><Footer /></div>
}



export default App;
